#  "X posted on Y's wall" (15 points),# 2. "X commented on Y's post" (10 points),# 3. "X likes Y's post" (5 points).def face(name,arr):    points={"posted":15,"commented":10,"likes":5}    dct=dict()    for i in arr:        c=3        if i[1]=="likes":            c=2        x = i[c][:len(i[c]) - 2]        if i[0]==name or x==name:            if i[0]==name:                dct[x]=dct.get(x,0)+points[i[1]]            else:                dct[i[0]] = dct.get(i[0],0) + points[i[1]]        else:            dct[i[0]]=dct.get(i[0],0)            dct[x]=dct.get(x,0)    if name in dct.keys():        dct.pop(name)    lst=[[x,y] for x,y in dct.items()]    lst=sorted(lst,key=lambda s:s[0])    lst=sorted(lst,key=lambda s:s[1],reverse=True)    for x,y in lst:        print(x)    return "" a=input()blanck=[]for i in range(int(input())):    lst=list(map(str,input().strip().split()))    blanck.append(lst) print(face(a,blanck))
